остью, на чердаках и в подвалах.Двустенные трубы могут быть изготовлены из:поливинилхлорида (ПВХ);полипропилена (ПП);полиэтилена высокого или низкого давления (ПВД или ПНД труба).По своей структуре гофрированная двустенная труба состоит из гладкого и пластичного внутреннего слоя и верхнего, более жесткого слоя гофры. Такое строение позволяет повсеместно использовать трубы этого типа при монтаже электрических сетей и линий телекоммуникаций. Труба ПНД двустенная также может применяться для обустройства дренажных и ливневых систем.Преимущества гофрированной двустенной трубы:гибкость и пластичность;гибкость ипластичность;малый вес;устойчивость к деформациям;срок службы до 50 лет;устойчивость к окислению, коррозии;способность выдерживать длительные статические нагрузки. \r\nНаша компания занимается свыше 10 лет производством полиэтиленовых труб высокого качества. \r\nМы будем рады Вас видеть у нас на вебресурсе', 'Добрый день друзья! \r\nhttps://www.civfanatics.ru/members/454851-Natashazuh\r\nhttps://forum.krymbezpravil.org.ua/viewtopic.php?f=12&t=38017\r\nhttp://www.ts-gaminggroup.com/showthread.php?91304-%D0%A1%E2%80%9A%D0%A1%D0%82%D0%A1%D1%93%D0%A0%C2%B1%D0%A0%C2%B0-%D0%A0%D1%96%D0%A0%D1%95%D0%A1%E2%80%9E%D0%A1%D0%82%D0%A0%D1%91%D0%A1%D0%82%D0%A0%D1%95%D0%A0%D0%86%D0%A0%C2%B0%D0%A0%D0%85%D0%A0%D0%85%D0%A0%C2%B0%D0%A1%D0%8F-%D0%A0%D2%91%D0%A0%D0%86%D0%A1%D1%93%D0%A1%D0%83%D0%A1%E2%80%9A%D0%A0%C2%B5%D0%A0%D0%85%D0%A0%D0%85%D0%A0%C2%B0%D0%A1%D0%8F-100&p=559803#post559803\r\nhttp://arabfm.net/vb/showthread.php?p=4187213#post4187213\r\nhttp://forum.soundspeed.ru/member.php?682044-Natasharwc\r\n \r\nТруба двустенная гофрированная широко используется для подземной прокладки инженерных коммуникаций при строительстве жилых и производственных объектов. Гофрированные трубы надежно защищают кабельные линии, водопроводные и канализационные сети от проникновения влаги и механических повреждений. Также они применяются в ливневых системах частных домов, для защиты систем теплоснабжен